import React,{Component} from 'react';
import './Order_confirm.css'
import dayjs from "dayjs"
import toArray from 'dayjs/plugin/toArray'
import axios from "axios";
import Showorder from '../Showorder';
class Order_confirm extends Component{
    constructor(props) {
        super(props);
        this.state = {
            date:dayjs().format("YYYY-MM-DD"),
            data: [],
            data1: [],
            name: "",
            tong: []
        };
      }
      componentDidMount() {
        axios.get("/orderadmin2").then(res => {
          console.log(res.data)
          this.setState({
            data: res.data.data,
            date1:res.data.time
          });
        });
      }
      render(){
      return(
        <div  className="navright">
            <h1> Đơn Hàng Chờ Xử Lý</h1>
            <div className="order">
              <Showorder data={this.state.data} date1={this.state.date1} name="Xác Nhận"></Showorder>
            </div>
        </div>
      )
    }
}
export default Order_confirm;
